import { useState } from "react";
import { motion, AnimatePresence } from 'framer-motion'
const array = [{id:1,title:"リンク"},{id:2,title:"<a>"},{id:3,title:"段落"},{id:4,title:"<p>"}]


export const Test =()=>{
  const [count, setCount] = useState(0)
  const [state, setState] = useState(array[0]);
  const handleOnClick =()=>{
    setCount(count+1)
    setState(array[count]);
  }

  return(
    <AnimatePresence>
      <motion.div key={state.id} initial={{x:0}} animate={{x:0}} exit={{x: -1000}} transition={{type: "tween", duration: 0.5}}>
        <div className="h-96 w-48 border a"></div>
        <div className="flex justify-center items-center text-3xl w-96 bg-red-500 h-96 border absolute -z-10" onClick={handleOnClick}>
          {state.title}
        </div>
      </motion.div>
      </AnimatePresence>
  );
}
